window.bookSummaryJSON = "<p>As a werewolf alpha's daughter, Sophie Gregory was raised to understand she has two important purposes in life—to be wed and bred. But after a disastrous arranged marriage, she flees to a neighboring pack and lands in the arms of Remy Arsenault, a serial dater and notorious womanizer. The French-speaking telepath is the last person she expects to rescue her, but she soon discovers there may be more to Remy than just a pretty face and a ripped body . . . </p> <p>Remy has a reputation for being a player, but when he sets his eyes—and his heart—on Sophie, everything changes. He'll do anything to win the hand of the curvy, captivating alpha's daughter. He's used to no one in the pack taking him seriously, but he's serious about shedding his playboy past and building a new future with the woman he loves.</p> <p>But when danger from Sophie's old pack threatens to keep them apart, Remy must save her life before he can give them a chance at forever. And if he fails, they could both lose everything.</p> <p>Contains mature themes.</p>"; 
